@hadisdanaeinia ‌
😂😂 ‌
اونجا خیلی شیر تو شیر شده. من همینجا اون کسایی رو که فکر میکنم جور باشیم رو منشن کردم.

من كاليفُرنيام يلدا .هفته ى پيش از سفرِ استانبول برگشتم و هر هفت روزش رو تو تمامِ شهر دنبالِ اين بودم كه شايد يه جايى يه جورى اتفاقى ببينمت. سالهاسا كاليفرنياىِ شمالى - حومه ى شهرِ سَن فرنسيسكو زندگى و در شهرِ لُس اَلتوس كار ميكنم. راستش انقدر اينجا همه گرفتار و بيزى هستن و اِسكجوال هاىِ كار و زندگيشون بهم نميخوره كه دوست كه هيچى، طرف با شوهرش نميتونه يه زمان سِت كنه و جايى بره مگر بيزينِسِ خودت رو داشته باشى يا يكى از پارتنرها كار نكنه. اوايل چندتا دوست اينجا پيدا كردم، اما از اونجا كه اهلِ بار و ديسكو و مشروب و مهمونى هاىِ شنبه شبِ تكرارىِ ايرونى ها نيستم و پول هم واسه كنسرت هاىِ خالو خالو نميدم و كلاً پايه ى تفريحاتِ ايرونى طورىِ ٩٩٪؜ ايرونى هاىِ آمريكا نيستم، دوستيهام كم رنگ تر و كم رنگ تر شدن و بعد هم كه اونايى كه مونده بودن مهاجرت كردن به شهرِ ديگه كه ارزونتر باشه زندگى براشون. در حالِ حاضر فقط يه دوست دارم كه اونم پارتنرم هست كه باهم سينما ميريم، عكاسى ميريم، خريد ميريم، شهربازى و سفر ميريم. من كلاً تو خونه بمونم اَنزايِتى ميگيرم و فقط و فقط عاشقِ تجربه كردن، كشفِ جاهاىِ جديد، و كيف كردن از هرچيزى كه در طبيعت هست هستم. اوه راستى اينم بگم منو اگه ميخواى بُكُشى بهم بگو شب بريم بيرون 😂 وقتى سان رايز و خورشيد و گل هاىِ رنگى و نور و زيبايى و سبزىِ روز هَست و ميشه رفت صبحونه و نهار خورد و كيف كرد و عكس هاىِ رنگى با رژِ لب هاىِ جيغ گرفت ، چه كاريه شب بريم بيرون 🤣🌿💘 من ٣٧ سالمه و مجرد ، اگه هركى از Bay area هست بوس به كله اش 😍 

